create database Person;
use Person;
create table Person (
	id INT,
	fullname VARCHAR(50),
	country VARCHAR(50),
	job VARCHAR(14),
	birthday DATE,
	gender VARCHAR(50),
	salary INT,
	hobbies VARCHAR(27)
);
-- Ý 1:Lấy danh sách các quốc gia duy nhất.
Select distinct (country)
From person;
-- Ý 2: Sắp xếp danh sách người theo tên đầy đủ (fullname) theo thứ tự tăng dần
Select *
from person
order by fullname asc;
-- Ý 3: Sắp xếp danh sách người theo nghề nghiệp (job) theo thứ tự giảm dần
Select *
from person
order by job desc;
-- Ý 4: Lấy danh sách các nghề nghiệp (job) duy nhất mà người trong bảng đang làm
select distinct(job)
from person;
-- Ý 5: Đếm số người theo từng quốc gia và sắp xếp theo số lượng người giảm dần.
select count(*),country
from person
group by country
order by count(*) desc;
-- Ý 6: Tính tổng lương (salary) của tất cả người trong bảng.
select sum(salary) as total_salary
from person;
-- Ý 7: Tính tổng lương trung bình của người theo từng nghề nghiệp (job) và sắp xếp theo lương trung bình tăng dần
select avg(salary),job
from person
group by job
order by avg(salary) desc;
-- Ý 8: Lấy ra người có lương (salary) lớn hơn 50000 và ngày sinh (birthday) nằm trong khoảng ‘1990-01-01’ đến ‘1995-12-31’
select *
from person
where salary > 5000 and birthday between '1990-01-01' and '1995-12-31';
-- Ý 9: Lấy ra người có lương (salary) lớn hơn 6000 và nghề nghiệp (job) là ‘Developer’ hoặc ‘Engineer’
select *
from person
where salary > 6000 and job in ('Developer','Engineer');
-- Ý 10: Lấy ra danh sách các nghề nghiệp (job) duy nhất mà có ít nhất 3 người làm.
select job
from person
group by job
having count(*) >= 3;
-- Ý 11: Lấy ra người nam (gender = ‘Male’) có lương (salary) cao nhất.
select *
from person
where gender = 'M' and salary = (select max(salary) from person) ;
-- Ý 12: Lấy ra người nữ (gender = ‘Female’) có lương (salary) thấp nhất
select *
from person
where gender = 'F' and salary = (select min(salary) from person) ;
-- Ý 13: Lấy danh sách người (không trùng lặp) theo thứ tự tên đầy đủ tăng dần
select distinct fullname
from person
order by fullname asc;
-- Ý 14: Đếm số người sinh vào các tháng khác nhau và sắp xếp theo thứ tự số lượng tăng dần.
select month(birthday),count(*)
from person
group by month(birthday)
order by count(*) asc;

